import React from 'react';
import './App.scss';
import { List } from './List/List';
import { FAMILIES } from './consts/families';

class App extends React.Component {
  render() {
    return (<div className="App">
      <div className="row">
        <div className="col-3">
          <List
            name="Families"
            listItems={Object.values(FAMILIES)}
          >
          </List>
        </div>
      </div>
    </div>
    );
  }
}

export default App;
